import React from 'react';
import ReactDom from 'react-dom';

const newDate = new Date().getHours();

let name = '';

const newStyle = {};

if (newDate >= 1 && newDate < 12) {
  name = 'Good Morning';
  newStyle.color = 'Green';
} else if (newDate >= 12 && newDate < 19) {
  name = 'Good Afternoone';
  newStyle.color = 'Orange';
} else {
  name = 'Good Evening';
  newStyle.color = 'red';
}

ReactDom.render(
  <>
    <div style={{ textAlign: 'center' }}>
      <h1>
        Hello, <span style={newStyle}>{name}</span>
      </h1>
    </div>
  </>,
  document.getElementById('root')
);
